import React, { useState } from 'react';
import './analysis.css'; // External CSS file for styling

const Tracker = () => {
  const [foodTime, setFoodTime] = useState('');
  const [sleepTime, setSleepTime] = useState('');

  const handleFoodChange = (event) => {
    setFoodTime(event.target.value);
  };

  const handleSleepChange = (event) => {
    setSleepTime(event.target.value);
  };

  return (
    <div className="tracker-container">
      <h2>Food and Sleep Cycle Tracker</h2>
      <div className="input-container">
        <label htmlFor="food-time">Food Time:</label>
        <input
          type="text"
          id="food-time"
          value={foodTime}
          onChange={handleFoodChange}
          placeholder="Enter food time"
        />
      </div>
      <div className="input-container">
        <label htmlFor="sleep-time">Sleep Time:</label>
        <input
          type="text"
          id="sleep-time"
          value={sleepTime}
          onChange={handleSleepChange}
          placeholder="Enter sleep time"
        />
      </div>
      <div className="info-container">
        <p>Food Time: {foodTime}</p>
        <p>Sleep Time: {sleepTime}</p>
      </div>
    </div>
  );
};

export default Tracker;
